        .container {
            max-width: 400px;
            margin: 50px auto;
            background: rgba(0, 0, 0, 0.8);
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0 0 15px rgba(0, 0, 0, 0.6);
            text-align: center;
        }

        h1 {
            font-size: 24px;
            font-weight: bold;
            color: #ffcc00;
            margin-bottom: 15px;
        }

        .form-group {
            margin-bottom: 15px;
        }

        label {
            display: block;
            margin-bottom: 5px;
            color: #fff;
            font-weight: bold;
        }

        input {
            width: 100%;
            padding: 10px;
            border: none;
            border-radius: 5px;
            margin-bottom: 10px;
        }

        button {
            width: 100%;
            padding: 10px;
            background: #ffcc00;
            color: #000;
            border: none;
            border-radius: 5px;
            font-size: 16px;
            font-weight: bold;
            cursor: pointer;
            transition: background 0.3s;
        }

        button:hover {
            background: #ff9900;
        }

        .result {
            margin-top: 20px;
            font-size: 18px;
            font-weight: bold;
            color: #00ff00;
        }

        footer {
            margin-top: 50px;
    text-align: center;
    font-size: 14px;
    color: #fff; /* Light color for contrast */
    font-family: 'Roboto', sans-serif;
    background-color: rgba(0, 0, 0, 0.7); /* Subtle dark background */
    padding: 20px;
    border-top: 2px solid #ffcc00; /* Golden line for separation */
        }

        footer a {
    color: #ffcc00; /* Color for links (social icons) */
    text-decoration: none;
        }

footer a:hover {
    color: #ff9900; /* Hover effect for links */
}
    </style>
</head>
<body>
    <div class="container">
        <h1>Traffic Estimation</h1>
        <form id="traffic-form">
            <div class="form-group">
                <label for="source">Source:</label>
                <input type="text" id="source" name="source" placeholder="Enter source location">
            </div>
            <div class="form-group">
                <label for="destination">Destination:</label>
                <input type="text" id="destination" name="destination" placeholder="Enter destination location">
            </div>
            <button type="button" onclick="geocodeAndSend()">Calculate</button>
        </form>
        <div class="result" id="result"></div>
    </div>
    <footer>
        Faisal Ahmed <br>
        Green University of Bangladesh
    </footer>
    <script>
        async function geocodeAddress(address) {
            const url = `https://nominatim.openstreetmap.org/search?format=json&q=${encodeURIComponent(address)}`;
            try {
                const response = await fetch(url);
                const data = await response.json();
                if (data.length > 0) {
                    return { lat: parseFloat(data[0].lat), lng: parseFloat(data[0].lon), display_name: data[0].display_name };
                } else {
                    throw new Error("Location not found");
                }
            } catch (error) {
                console.error(error);
                throw new Error("Failed to fetch coordinates");
            }
        }

        async function geocodeAndSend() {
            const source = document.getElementById("source").value;
            const destination = document.getElementById("destination").value;

            const resultDiv = document.getElementById("result");
            resultDiv.textContent = "Calculating...";

            try {
                const sourceCoords = await geocodeAddress(source);
                const destinationCoords = await geocodeAddress(destination);

                // Check if the locations are outside Dhaka (simple check for Dhaka in the display_name)
                const isOutsideDhaka = !sourceCoords.display_name.includes("Dhaka") || !destinationCoords.display_name.includes("Dhaka");
                
                fetch("/calculate", {
                    method: "POST",
                    headers: {
                        "Content-Type": "application/json",
                    },
                    body: JSON.stringify({
                        source_lat: sourceCoords.lat,
                        source_lon: sourceCoords.lng,
                        dest_lat: destinationCoords.lat,
                        dest_lon: destinationCoords.lng,
                    }),
                })
                    .then((response) => response.json())
                    .then((data) => {
                        if (data.travel_time) {
                            let message = `Estimated Travel Time: ${data.travel_time} minutes`;
                            if (isOutsideDhaka) {
                                message += " (Please note: This estimation may not be fully accurate for locations outside Dhaka)";
                            }

                            // Show actual and estimated times if available
                            if (data.base_time) {
                                message += `<br>Actual Time (without delays): ${data.base_time} minutes`;
                            }

                            resultDiv.innerHTML = message;

                            // Ask the user if they want to see the map
                            setTimeout(() => {
                                const userWantsMap = confirm("Wanna see the map?");
                                if (userWantsMap) {
                                    window.location.href = "/static/route_map.html";
                                } else {
                                    resultDiv.textContent += "<br>Map viewing skipped.";
                                }
                            }, 3000);
                        } else {
                            resultDiv.textContent = `Error: ${data.error}`;
                        }
                    });
            } catch (error) {
                resultDiv.textContent = `Error: ${error.message}`;
            }
        }
    </script>
</body>
